前に自分で考えたり、ドキュメントを確認してください",author:"作者メール：anqi4051{'@'}gmail.com",qa:[{q:"なぜリポジトリが常に読み込みに失敗するのですか？",a:"リポジトリはGitHubのアドレスを使用しており、中国からの直接接続は断続的になる可能性があり、これは正常な現象です。開かない場合は何度か試すか、数分後に再試行してください。BGIのローカルリポジトリページも使用できます。（魔法使いの方は、どうすればよいかご存知です）"},{q:"なぜコメント機能が利用できないのですか？",a:"ローカルモードではコメントがサポートされていません。オンラインリポジトリにアクセスしてGitHubアカウントにログインしてからコメントしてください。GitHubの使用方法は自分で調べてください。"},{q:"なぜXXスクリプトがないのですか？",a:"検索する際は、キーワードが正確であることを確認してください。例えば「スイートフラワー」などです。すべてを検索しても見つからない場合は、作者が書いていないということです。自分で書いてみることもできます。"},{q:"購読機能はどのように使用しますか？",a:"「BetterGI → 設定 → BetterGI Http サーバー設定」（この設定が見つからない場合は、BGIが最新版に更新されていることを確認してください）、この項目が有効で、ポート番号が30648に設定されていることを確認してください。完了後、このページを閉じてBGIを再起動して再試行してください。まだ問題がある場合は、作者に連絡して解決してください。"},{q:"READMEとは何ですか、なぜ読み込みに失敗したのですか？なぜ表示されないのですか？",a:"まずREADMEを読んでください、理解できましたか？読み込み失敗は最初の質問と同じです。表示されないのは、そのディレクトリにREADME.mdファイルが存在しないからです。"},{q:"なぜ一部のリンクがクリックできないのですか？なぜ長時間読み込みしても読み込まれないのですか？",a:"最初の質問と同じです。"},{q:"購読をクリックした後、なぜ反応がないのですか？",a:"BGIを開いてください。この時、インポートウィンドウがポップアップします。インポートを選択してください。オンラインリポジトリを使用している場合、BGIページを更新した後、購読したスクリプトが表示されない場合は、ローカルリポジトリを更新して再試行してください。まだ異常がある場合は、関連グループで質問してください。"},{q:"このスクリプトが使えない場合はどうすればよいですか？",a:"関連グループで質問してください。具体的な問題は具体的に分析します。質問する際は、スクリーンショットと説明が十分であることを確認してください。"},{q:"以前のコメントがなぜ消えたのですか？",a:"一般的にコメントは削除されません。コメントが消えた場合、コメントしたノードパスが変更された可能性が高いです。例えば、クリスタル鉱石ディレクトリがクリスタルウォーター鉱石に名前が変更された場合、新しいコメントセクションが表示されます。"},{q:"なぜこのスクリプトはナヒーダを使用しないのですか？",a:"作者は全員が持っているかどうかを考慮する必要があります。必要な場合は、自分で作ってみてください。"},{q:"XX機能が欲しい場合はどうすればよいですか？",a:"作者が書いていない場合は、自分で書いてください！"},{q:"その他",a:"その他の質問については、私に連絡してください。価値がある場合は、このページも不定期に更新されます。"}]},zMe={descTitle:"説明：",noDesc:"説明なし",loadTimeout:"読み込みタイムアウト",loadFailed:"読み込み失敗",clickToViewFile:"GitHubリポジトリのファイルをクリックして表示",clickToViewDir:"GitHubリポジトリのディレクトリをクリックして表示",invalidLinkHint:"（この作者は愚かでリンクを間違えました。修正するよう彼らに伝えてください）"},GMe={help:"ヘルプ",jumpToGitHub:"GitHub",comment:"コメント",subscribe:"ワンクリック更新",update:"更新を確認",recent:"最近の更新",updateAll:"全ての購読を更新しますか？",clearDot:"赤い点を消す",subscribed:"購読済み",confirm:"確認",cancel:"キャンセル"},VMe={subs mentée avant d'être posée",author:"Email de l'auteur : anqi4051{'@'}gmail.com",qa:[{q:"Pourquoi le dépôt échoue-t-il toujours à charger ?",a:"Le dépôt utilise des adresses GitHub, et les connexions directes depuis la Chine peuvent être intermittentes, ce qui est normal. Si cela ne s'ouvre pas, essayez plusieurs fois ou revenez dans quelques minutes. Vous pouvez aussi utiliser la page de dépôt local de BGI. (Si vous êtes un magicien, vous savez quoi faire)"},{q:"Pourquoi la fonction de commentaire n'est-elle pas disponible ?",a:"Les commentaires ne sont pas pris en charge en mode local. Veuillez visiter le dépôt en ligne et vous connecter à votre compte GitHub pour commenter. Comment utiliser GitHub, veuillez chercher vous-même."},{q:"Pourquoi n'y a-t-il pas de script XX ?",a:`Lors de la recherche, essayez de vous assurer que les mots-clés sont précis, comme "Fleur Douce". Si vous avez tout cherché et que vous ne le trouvez toujours pas, alors aucun auteur ne l'a écrit. Vous pouvez essayer d'en écrire un vous-même.`},{q:"Comment utiliser la fonction abonné ?",a:`"BetterGI → Paramètres → Paramètres du Serveur Http BetterGI" (si vous ne trouvez pas ce paramètre, assurez-vous que BGI est mis à jour vers la dernière version), assurez-vous que cet élément est activé et que le numéro de port est défini sur 30648. Après avoir terminé, fermez cette page et redémarrez BGI pour réessayer. S'il y a encore des problèmes, contactez l'auteur pour résolution.`},{q:"Qu'est-ce que README, pourquoi a-t-il échoué à charger ? Pourquoi n'est-il pas affiché ?",a:"Lisez d'abord README vous-même, comprenez-vous ? L'échec de chargement est le même que la première question. Il n'est pas affiché car il n'y a pas de fichier README.md dans ce répertoire."},{q:"Pourquoi certains liens ne peuvent-ils pas être cliqués ? Pourquoi cela charge-t-il longtemps sans charger ?",a:"Même que la première question."},{q:"Pourquoi n'y a-t-il pas de réponse après avoir cliqué sur s'abonner ?",a:"Veuillez ouvrir BGI, une fenêtre d'importation apparaîtra, sélectionnez importer. Si vous utilisez le dépôt en ligne et que le script auquel vous vous êtes abonné n'apparaît pas après avoir actualisé la page BGI, mettez à jour le dépôt local et réessayez. S'il y a encore des problèmes, demandez dans le groupe pertinent."},{q:"Que faire si ce script ne fonctionne pas ?",a:"Veuillez demander dans le groupe pertinent, les problèmes spécifiques nécessitent une analyse spécifique. Lors de la demande, assurez-vous que vos captures d'écran et descriptions sont suffisantes."},{q:"Pourquoi mes commentaires précédents ont-ils disparu ?",a:"Les commentaires ne sont généralement pas supprimés. Si les commentaires disparaissent, il est probable que le chemin du nœud sur lequel vous avez commenté ait changé. Par exemple, si le répertoire Crystal Ore a été renommé en Crystal Water Ore, vous verrez une nouvelle section de commentaires."},{q:"Pourquoi ce script n'utilise-t-il pas Nahida ?",a:"Les auteurs doivent considérer si tout le monde l'a. Si nécessaire, essayez d'en faire un vous-même."},{q:"Que faire si je veux la fonction XX ?",a:"Si aucun auteur ne l'a écrit, écrivez-en un vous-même !"},{q:"Autres",a:"Pour plus de questions, contactez-moi. Si c'est précieux, cette page sera mise à jour périodiquement."}]},sLe={descTitle:"Description : ",noDesc:"Aucune description",loadTimeout:"Délai d'attente de chargement",loadFailed:"Échec du chargement",clickToViewFile:"Cliquez pour voir le fichier dans le dépôt GitHub",clickToViewDir:"Cliquez pour voir le répertoire dans le dépôt GitHub",invalidLinkHint:"(Cet auteur est stupide et a mal écrit le lien, allez lui rappeler de le corriger)"},cLe={help:"Aide",jumpToGitHub:"GitHub",comment:"Commentaire",subscribe:"Mise à jour en un clic",update:"Vérifier les mises à jour",recent:"Mises à jour récentes",updateAll:"Mettre à jour tous les abonnements ?",clearDot:"Effacer le point rouge",subscribed:"Abonné",confirm:"Confirmer",cancel:"Annuler"},uLe={subscribed:
